import React, { Component } from 'react';
import '../../css/mainpage.css'

class Mainpage extends Component {
    render() {
        return (
            <div>
                <div className="uppercols">
                <div className='left'>
                   <span> <p>Tempus es una plataforma de trabajo en equipo donde podras trabajar comodamente desde tu casa sin tener que ir a tu oficina</p></span>
                         <button className="button-36" >Quiero saber mas!</button>

                </div>
                <div className='right'>
                <div className='upperImage'>
                    
                </div>
                </div>
                </div>
                
            </div>
        );
    }
}

export default Mainpage;
